(63792, 'AA4381FC-5A2F-42AD-BEF1-37846249955F', 'Love, before I head out tonight I want to thank you for being the loveliest partner I could have dreamed of. I appreciate how we are learning together and on our own‚Ä¶.and that you (and I) are finding new ways to listen deeply to one another and disrupt some of the patterns that we can outgrow. It is not a linear path, for sure. I feel inspired by you to push myself to be a better man, husband, partner, lover, friend and father every day. I‚Äôm looking forward to going out and having some play time‚Ä¶and being the luckiest guy alive to come home and have you fall asleep with me holding you. I love you to the moon and back.', 'David', 'Nitzan', '2023-01-09T17:43:22.423630'),
(63793, '51D827E8-43FD-4F03-BCF8-BEF4D5782D54', 'Thank you my sweets for this very kind and thoughtful note. I‚Äôm grateful to be with you every day. You inspire me to be a better partner, listener, co-conspirator, and parent. You are accountable and kind. And you want to do the right thing. That makes me want to do the right thing too. When you lean into being a better person, it makes me want to be a better partner to you too. ', 'Nitzan', 'David', '2023-01-09T18:11:22.801953'),
(63794, '1731E970-3971-49E1-A38B-00890A26F24B', 'IÔ∏è also have some thoughts about our convo in therapy and with self regulation that we can chat about later. It‚Äôs about role modeling behavior we want to see in each other. When you are the best version of yourself, those are 100% the moments IÔ∏è want to match you and be the best version of myself. Will say more about that later.', 'Nitzan', 'David', '2023-01-09T18:14:07.838349'),
(63795, 'D7EAF306-5468-47FE-8821-569C5CE8C2C0', 'IÔ∏è want to thank you for being in it with me, week after week, with Pricilla. It‚Äôs hard work. And IÔ∏è know it feels uncomfortable. But you do it with me so that we can get stronger and better. And we are so much stronger and better for it. ', 'Nitzan', 'David', '2023-01-09T18:15:13.369620'),
